import React, { useState } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import './Header.css';

function Header() {
  const [showSubNav, setShowSubNav] = useState(false);

  // Toggle the secondary nav
  const toggleSubNav = () => {
    setShowSubNav(!showSubNav);
  };

  return (
    <>
      {/* Primary Navigation */}
      <header className="bg-white border-bottom shadow-sm">
        <Navbar expand="lg" className="py-3">
          <Container>
            {/* Logo */}
            <Navbar.Brand href="#home">
              <img
                src="logo-placeholder.png" // Replace with actual logo path
                alt="Salada Logo"
                className="logo"
              />
            </Navbar.Brand>

            {/* Navbar Links */}
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="mx-auto">
                <Nav.Link
                  href="#shop"
                  className="fw-bold text-dark"
                  onClick={toggleSubNav}
                >
                  Shop
                </Nav.Link>
                <Nav.Link href="#blog" className="fw-bold text-dark">Blog</Nav.Link>
                <Nav.Link href="#about" className="fw-bold text-dark">About Us</Nav.Link>
                <Nav.Link href="#rewards" className="fw-bold text-dark">Rewards</Nav.Link>
                <Nav.Link href="#contact" className="fw-bold text-dark">Contact</Nav.Link>
                <Nav.Link href="#find" className="fw-bold text-dark">Find In Store</Nav.Link>
              </Nav>

              {/* Account and Cart */}
              <Nav className="ms-auto">
                <Nav.Link href="#account" className="fw-bold text-dark">Account</Nav.Link>
                <Nav.Link href="#cart" className="fw-bold text-dark">Cart (0)</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
      </header>

      {/* Secondary Navigation (SubNav) */}
      {showSubNav && (
        <nav className="secondary-nav bg-white border-top">
          <Container>
            <Nav className="justify-content-center py-2">
              <Nav.Link href="#shop-all" className="fw-bold text-dark">Shop All</Nav.Link>
              <Nav.Link href="#best-sellers" className="fw-bold text-dark">Best Sellers</Nav.Link>
              <Nav.Link href="#green-tea" className="fw-bold text-dark">Green Tea</Nav.Link>
              <Nav.Link href="#matcha-green-tea" className="fw-bold text-dark">Matcha Green Tea</Nav.Link>
              <Nav.Link href="#herbal-tea" className="fw-bold text-dark">Herbal Tea</Nav.Link>
              <Nav.Link href="#white-tea" className="fw-bold text-dark">White Tea</Nav.Link>
              <Nav.Link href="#black-tea" className="fw-bold text-dark">Black Tea</Nav.Link>
              <Nav.Link href="#decaf-tea" className="fw-bold text-dark">Decaf Tea</Nav.Link>
              <Nav.Link href="#gift-cards" className="fw-bold text-dark">Gift Cards</Nav.Link>
              <Nav.Link href="#merch" className="fw-bold text-dark">Merch</Nav.Link>
            </Nav>
          </Container>
        </nav>
      )}
    </>
  );
}

export default Header;
